import { Route, Routes } from 'react-router-dom';
import './App.css';
import Admin from './Components/Pages/Admin';
import ScheduleHome from './Components/Pages/ScheduleHome';
import DataProvider from './Context/DataContext';
import QuestionPlayer from './Components/QuestionPlayer'
import Home from './Home';


function App(props) {
  return (
      <DataProvider>

        <div className="App">
        <div className='main_app'>

        <Routes>
            <Route exact path="/" element={<Home />} />
            <Route exact path="/Admin" element={<Admin />} />
            <Route exact path="/ScheduleHome" element={<ScheduleHome />} />
              <Route exact path="/QuestionPlayer" element={<QuestionPlayer  />} />
             { /*  <Route exact path="/GetAllTest" element={<GetAllTest />} />
              <Route exact path='/Test/:test_number' element= {<Test />} />
  <Route exact path="/gpd" element={<GPD />} />  */}
          </Routes>

        </div>   
        </div>

    </DataProvider>
    );
}

export default App;
